import React from 'react';
import PropTypes from 'prop-types';
import helpers from 'utils/helpers';

const ApplicantDetailedInfo = ({
  name,
  instagramId,
  instagramVisibility,
  isInstagramVerified,
  birthDate,
  displayGender,
}) => {
  console.log('ApplicantDetailedInfo');
  return (
    <div className="applicant-detailed-info box">
      <div>
        <span>Name:</span>
&nbsp;
        {name}
      </div>
      <div>
        <span>Instagram ID:</span>
&nbsp;
        {instagramId}
      </div>
      <div>
        <span>Instagram Visibility Settings:</span>
&nbsp;
        {instagramVisibility}
      </div>
      <div>
        <span>Instagram Verified?: </span>
        {isInstagramVerified}
      </div>
      <div>
        <span>Age: </span>
        {helpers.calculateAge(birthDate)}
      </div>
      <div>
        <span>Display Gender: </span>
        {displayGender}
      </div>
    </div>
  );
};

ApplicantDetailedInfo.propTypes = {
  name: PropTypes.string.isRequired,
  instagramId: PropTypes.string.isRequired,
  instagramVisibility: PropTypes.string.isRequired,
  isInstagramVerified: PropTypes.string.isRequired,
  birthDate: PropTypes.instanceOf(Date).isRequired,
  displayGender: PropTypes.string.isRequired,
};

export default ApplicantDetailedInfo;
